import React from "react";
import {Routes, Route, Navigate} from 'react-router-dom'

import Home from './../pages/Home';
import Login from './../pages/Login';
import Register from './../pages/Register';
import SearchResultList from './../pages/SearchResultList';
import EntrepriseDetails from '../pages/EntrepriseDetails';
import Tours from '../pages/Entreprises';

const Routers = () => {
    return (
    <Routes>
        <Route path="/" element = {<Navigate to ="/home" />} />
        <Route path="/home" element ={<Home />} />
        <Route path="/entreprises" element ={<Tours />} />
        <Route path="/entreprises/:id" element ={<TourDetails />} />
        <Route path="/login" element ={<Login />} />
        <Route path="/register" element ={<Register />} />
        <Route path="/entreprises/search" element ={<SearchResultList />} />
        
        

    
    </Routes>
    );

};
export default Routers;
